DROP TABLE IF EXISTS what_locks;
CREATE TABLE what_locks (
	item_id INT NOT NULL,
	skill_id INT NOT NULL,
	duration INT NOT NULL
);


CREATE INDEX IF NOT EXISTS idx_what_locks_item_id ON what_locks(item_id);
CREATE INDEX IF NOT EXISTS idx_what_locks_skill_id ON what_locks(skill_id);
CREATE INDEX IF NOT EXISTS idx_what_locks_skill_duration ON what_locks(duration);
